Core:PCProperties.Core:Property:
         X[M] /*                                                                                  
** Return a description of how well this score relates to speaking a language **                                                                                   
** Parameter: \$skill                                                                                   
*/                                                                                   

switch(\$skill)                                                                                  
\{                                                                                  
  case 1: return "barely";        
  case 2: return "barely";       
  case 3: return "barely";   
  case 4: return "barely";     
  case 5: return "barely";                                                                       
  case 6: return "terribly";     
  case 7: return "terribly";    
  case 8: return "terribly";                                                                                 
  case 9: return "somewhat";           
  case 10: return "somewhat";     
  case 11: return "somewhat";                                                                            
  case 12: return "haltingly";    
  case 13: return "haltingly";    
  case 14: return "haltingly";                                                                                  
  case 15: return "pretty well";     
  case 16: return "pretty well";    
  case 17: return "pretty well";                                                                                 
  case 18: return "very well";        
  case 19: return "very well";      
  case 20: return "very well";      
  case 21: return "very well";     
  case 22: return "very well";     
  case 23: return "very well";                                                                      
  default: return "fluently";                                                                                  
\}                                                                                  

return "fluently";
